function [ys_, params, info] = steadystate(ys_, exo_, params)
% Steady state generated by Dynare preprocessor
    info = 0;
    ys_(18)=1;
    ys_(15)=ys_(18)*(1-params(7))/(params(4)*params(1)*(params(7)+params(8)))*(params(4)*params(1)*(params(7)+params(8))/(params(1)*(params(7)+params(8))-params(8)))^(1/(1+params(5)))/params(3);
    ys_(17)=params(3)*(params(7)+params(8))*(params(1)-1)*ys_(15)^(params(1)/(params(1)-1))/(1-params(7));
    ys_(8)=ys_(15)^(1/(params(1)-1));
    ys_(10)=ys_(18)*ys_(8)/params(9);
    ys_(9)=(1-1/params(9))*ys_(17)/ys_(15);
    ys_(16)=params(3)*ys_(10)/ys_(18);
    ys_(14)=ys_(15)*params(7)/(1-params(7));
    ys_(11)=(ys_(10)/ys_(17)/params(4))^params(5);
    ys_(6)=ys_(17)+ys_(16)*ys_(14);
    ys_(7)=ys_(10)*ys_(11)+ys_(15)*ys_(9);
    ys_(12)=params(3)*ys_(14)/ys_(18);
    ys_(13)=ys_(11)-ys_(12);
    ys_(19)=log(ys_(17)/ys_(8));
    ys_(20)=log(ys_(17));
    ys_(23)=log(ys_(9));
    ys_(24)=log(ys_(9)/ys_(8));
    ys_(25)=log(ys_(16));
    ys_(26)=log(ys_(16)/ys_(8));
    ys_(30)=log(ys_(10));
    ys_(31)=log(ys_(10)/ys_(8));
    ys_(33)=log(ys_(6));
    ys_(34)=log(ys_(6)/ys_(8));
    ys_(27)=log(ys_(11));
    ys_(28)=log(ys_(12));
    ys_(29)=log(ys_(13));
    ys_(21)=log(ys_(14));
    ys_(22)=log(ys_(15));
    ys_(32)=log(ys_(8));
    ys_(1)=ys_(16)/ys_(17);
    ys_(2)=ys_(16)/ys_(6);
    ys_(3)=ys_(15)*ys_(16);
    ys_(4)=ys_(3)/ys_(17);
    ys_(5)=ys_(3)/ys_(6);
    % Auxiliary equations
end
